INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1137', 'P01180709', '在进入弛星学习半个月之后，觉得收获颇丰，就我个人的学习而言，因为本身基础比较薄弱，所以学习起来稍有费劲，但是在老师同学的热情帮助下，进步也较为明显。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1148', 'P01180709', '詹老师讲的很好，对学生很负责任，也很有耐心，问题都会有讲解，就是对于我这种基础不好的学生来说讲的的有点太快了，有一点跟不上听不大懂，希望老师能稍微减缓一点，照顾一下基础不好的学生，总的来说詹老师是个很', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1159', 'P01180709', '老师讲的很认真       很负责        不会的也会及时解决                                                                  ', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1170', 'P01180709', '感觉学的还行吧  相对来说 代码打出来还是有点困难 老师讲的满详细的 但是我希望 每次留完作业代码 希望有的在课堂上及时讲解出来 毕竟我觉得大部分同学可能做得都不好吧
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1181', 'P01180709', '就我个人而言晚自习时总是想赵老师问问题，无奈问问题的人很多，回答问题的却只有老师一人，是否可以成立个互帮小组，这样就可以组内解决，提高晚自习效率。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1192', 'P01180709', '课程讲解速度较快，建议教师多带学生能够复习总结。（ 面向对象最重要的概念就是类（Class）和实例（Instance），必须牢记类是抽象的模板，而实例是根据类创建出来的一个个具体的“对象”）好', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1203', 'P01180709', '教学上能够更加细致，照顾到基础差的学生，帮助我们理清学习思路，做到让我们知道学习的具体流程，布置的作业能够细致讲解。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1214', 'P01180709', '对于基础差的童鞋，还是希望老师能多跟我们讲一下学习方法， 因为有时候感觉自己使不上劲儿，人常说“态度加方法”，态度没问题的基础上，还学不会我觉得一方面是理解能力，另一方面就是学习方法不对。老师辛苦了。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1225', 'P01180709', '没用建议，很是满意，詹老师讲的很好，对我们很负责任，不让任何一个人落下，班主任也很关心我们。每天都会单独的找我们聊聊学习是否能够跟的上，有没有难度之类的问题，也很关心我们的生活', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1236', 'P01180709', '希望老师能够晚自习的时候多呆在教室指导我们学习，希望老师能够讲解布置的作业，老师上课布置的作业不要太难，希望老师每天可以提前五分钟到教室，希望老师能够及时了解我们学习的情况，一百字不够写的。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1247', 'P01180709', '多讲基础知识，基础知识与项目相结合，不一定非要做大项目。同时希望讲课速度慢一点，作为零基础学Python的学子，偶尔跟不上节奏，当然，老师是非常负责认真的，很有耐心。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1258', 'P01180709', '学习进度有点快。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1269', 'P01180709', '没意见，真的没意见，没什么说的。这里环境很好，周围的同伴相处也都还好，就是中午睡觉空调有点冷，还有就是上课容易犯困，薄荷糖的薄荷味不够浓。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1280', 'P01180709', '课后可以多给我们几道练习题，让大家自己选择其中一个题以作业的形式提交。这样我们写完课后作业后如果有剩余时间还可以将其他的题目也写写', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1291', 'P01180709', '项目经理讲课认真负责，将的知识点很细，在学生的掌握程度上可以多做了解，适当的加快或者降低速度，班主任可以多关心学生生活情况，调节学生上课情绪，及时解决学生遇见的生活上遇见的问题', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1302', 'P01180709', '希望詹老师增加与同学的课上互动，讲课时能讲的更详细一些，感觉基础不好的同学（包括我）有时跟不上，放慢一下节奏，做作业的时候经常没有思路，需要同学的帮助才能完成，希望第二天能讲解一下昨天留下的作业。。。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1313', 'P01180709', '希望詹老师能将理论知识生动形象的讲给我们听，太理论化的知识使我犯困。。。。。。。。。。。。。。。。。。。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1324', 'P01180709', '希望詹老师讲课更有激情一点，希望不要一次讲2个小时，听的时间长了很困倦，希望多给练习的时间，讲练一体，这样也能降低犯困，', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1335', 'P01180709', '上课进度有些快，刚学的知识还未掌握牢固就进行新的内容学习。知识小点能够理解，但用当前所学知识写实例时无从下手，不知如何进行。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1346', 'P01180709', '每天给我们练习的时间太少，晚自习虽然让我们在这里自习，可是遇到不懂得问题，我去问谁呢？在这自习又有什么意义。我们来这里希望锻炼的不仅是学习方面的知识，说演讲，几个星期讲一次，这能锻炼什么呢！人太多。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1357', 'P01180709', '希望老师能够对作业和平常练习多一些更细致的讲解，有时的课堂练习并没有完全掌握但是必须开始下一个知识点的学习，还希望上课与练习的时间能够更频繁的分配，有时连续的上课真的很困，不能一直
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1368', 'P01180709', '感觉讲的有点快，作为零基础的学员很吃力，而且上课时讲解知识点一讲就至少一个半小时，没有时间自己消化理解，等到了晚上，还得重新看，一个一个研究，浪费了很多时间，希望讲课与练习相结合，提高学习效率。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1379', 'P01180709', '老师与学生之间能加强交流，最好老师能尽量调动我们在学习上的兴趣，并很好地引导我们去学习，虽然能听到老师的逻辑，但自己很难敲出来。希望班上能有活泼的学习氛围。还有就是每天容易忘记按时打卡', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1390', 'P01180709', '好啊，在此次的几周中，我冲份的体现学习的压力，但是我还是认为时间还是有进一步的压榨空间。还有就是班内没有相关的python书籍，无法进行进一步的了解python，建议买些书籍，方便同学查阅。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1401', 'P01180709', '有些布置的作业老师没有讲；有些课时上有点听不懂老师的逻辑；老师和苏子姐都很认真负责，老师的那些课外思想超级好，超nice!', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
INSERT INTO "CX"."SYS_SUGGEST" VALUES ('1412', 'P01180709', '目前感觉还是比较好的，不过教室有点小，人挺多的，显得有点拥挤，有时老师观察不到后面的情况，不过也还可以接受。', TO_DATE('2018-07-30 00:00:00', 'YYYY-MM-DD HH24:MI:SS'), '詹老师', '18a6f822-7e11-4f0b-9582-078949b2ecaf');
